name: Deploy

on:
  push:
    branches:
      - main

jobs:
  build:
    runs-on: ubuntu-latest
    steps:
      - name: Setup Node.js
        uses: actions/setup-node@v2
        with:
          node-version: '14'
      - name: Install dependencies
        run: |
          npm config set //npm.pkg.github.com/:_authToken ${{ secrets.TRIOLOGY_PACKAGES_TOKEN }}
          npm ci
          npm config set @trilogy-group/registry https://npm.pkg.github.com
          cd deploy
          npm ci
      - name: Check modified projects
        uses: dchorny/paths-filter@v2
        id: changes
        with:
          token: ${{ secrets.GITHUB_TOKEN }}
          filters: .github/projects.yml
          base: ${{ github.ref }}
      - name: Prepare CDK parameters
        run: Prepare
        uses: actions/github-script@v6
        with:
          script: |
            let projects = '';
            let env = '';
            if (context.eventName == 'workflow_dispatch') {
              projects = ${{ github.event.inputs.projects }};
              env = ${{ github.event.inputs.env }};
            } else {
              // Use output from the previous step to find out modified projects
              projects = ${{ fromJson(steps.changes.outputs) }};
              const changes = Object.entries(changes)
              projects = Object.entries(changes)
            }
          steps: Item 57 - with: filters: .github/projects.yml
